        <p class=""f_size"">There are three ways to deconstruct a tuple:</p>

        <p class=""f_size"">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;<b>&#x2022;</b>You can explicitly declare the type of each field inside 
